import React from "react";
import { Typography, Box } from "@mui/material";

const HistoryPage = () => {
  return (
    <Box p={4}>
      <Typography variant="h4">Prompt History</Typography>
      <Typography mt={2}>See all your previous questions and responses.</Typography>
    </Box>
  );
};

export default HistoryPage;
